import React from 'react'
import styled from 'styled-components/native'

const Container = styled.View`
  margin-top: 60px;
`

const Text = styled.Text`
  font-size: 25px;
`

export default function Gerador() {
  return(
    <Container>
      <Text>ok</Text>
    </Container>
  ) 
}
